def run(input_str: str) -> list:
    input_list = input_str.split(",")
    num = list(map(float, input_list))

    pre_data_set = {
        'Gc-content': [num]
    }
    result = multi_class_nn(pre_data_set=pre_data_set)
    return result


# Test set, plotted to compare predicted and actual values
def test_validate(x_test, y_test, y_predict, classifier):
    x = range(len(y_test))
    plt.plot(x, y_test, "ro", markersize=5, zorder=3, label=u"true_species")
    plt.plot(x, y_predict, "go", markersize=8, zorder=2,
             label=u"predict_species,$R$=%.3f" % classifier.score(x_test, y_test))
    plt.legend(loc="upper left")
    plt.xlabel("Tested Number")
    plt.ylabel("True Test")
    plt.show()


# Neural network numerical classification
def multi_class_nn(pre_data_set: dict):
    # digits = datasets.load_digits()
    # x = digits['data']
    # y = digits['target']
    x = my_data_set["Gc-content"]
    y = my_data_set["Species"]
    test = pre_data_set['Gc-content']
    # Normalization
    ss = StandardScaler()
    x_regular = ss.fit_transform(x)
    # Division
    x_train, x_test, y_train, y_test = train_test_split(x_regular, y, test_size=0.30)
    # print(x_train)
    # print(x_test)
    # print(y_train)
    # print(y_test)
    clf = MLPClassifier(solver='lbfgs', alpha=1e-5, hidden_layer_sizes=100, random_state=7)
    clf.fit(x_train, y_train)
    # Effects
    r = clf.score(x_train, y_train)
    print("R(accuracy):", r)
    # Prediction
    y_predict = clf.predict(x_test)
    prediction = clf.predict(test)  # Designed predictions for the final results
    # print("Training Group")
    # print(y_test)
    # print("Testing Group")
    # print(y_predict)
    print("Prediction Results：", prediction)
    # Plot and Test
    test_validate(x_test=x_test, y_test=y_test, y_predict=y_predict, classifier=clf)
    return [prediction, r]
